  `element_remark` text,
  `element_image` longtext,
  `create_date` text,
  `localname` text,
  `ID` char(32) NOT NULL,
  `SERIAL_NO` int(11) NOT NULL,
  `scene_id` int(11) DEFAULT NULL,
  `CREATE_USER_ID` char(32) DEFAULT NULL,
  `INVESTIGATION_ID` char(32) DEFAULT NULL,
