  `LEFT_POSITION` varchar(300) DEFAULT NULL COMMENT '遗留部位',
  `COLLECTION_MODE` varchar(4) DEFAULT NULL COMMENT '显现/提取方法 直接照相=A01，粉末/胶带纸=A02，粉末/照相=A03，502/照相=A04，DFO/照相=A05, 茚三酮/照相=A06, 硝酸银/照相=A07, 碘熏/照相=A08, 其他/照相=A09',
  `COLLECTED_BY_NAME` varchar(250) DEFAULT NULL COMMENT '提取人',
  `COLLECTED_DATE` datetime DEFAULT NULL COMMENT '提取日期',
  `CRIMINAL_FLAG` varchar(4) DEFAULT NULL COMMENT '可靠程度 是=1，疑似=2 默认空',
  `UTILIZATION` varchar(4) DEFAULT NULL COMMENT '利用情况 查档认定=A，鉴定认定=B，串并认定=C，排除嫌疑=D，其他利用=E，尚未利用=F',
  `MATCH_PERSON_NAME` varchar(20) DEFAULT NULL,
  `MATCH_PERSON_ID` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

